import React from 'react';

export default function Nav() {
    return (
        <nav className="menu">
            <a href="#home">Home</a>
            <a href="#sobre">Sobre</a>
            <a href="#habilidades">Habilidades</a>
            <a href="#projetos">Projetos</a>
        </nav>
    );
}
